import React from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const DataCard = ({ data }) => {
	const results = data.data;

	const resultsArr = results.map(items => {
		return items;
	});

	//console.log(typeof resultsArr[0]);

	const nyt = resultsArr[0];
	const gaurdian = resultsArr[1];

	//console.log(nyt);

	if (typeof nyt !== 'undefined') {
		nyt.map(item => {
			console.log(item);
		});
	}

	if (typeof gaurdian !== 'undefined') {
		const mappped = gaurdian.map(item => {
			return item;
		});
		console.log(mappped);
	}

	return <h1>DataCard</h1>;
};

DataCard.propTypes = {
	DataCard: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps)(DataCard);
